import React from 'react';
import {Switch, Route} from 'react-router-dom'
import Navigation from '../components/Navigation';

const Home = ()=>{
    return(
        <div>
            <Navigation />
            <Switch>
                <Route path={"/admin/home"}>
                    <div>HOME</div>
                </Route>
            </Switch>
            Home Page
        </div>
    )
}

export default Home;
